const allViews = Object.keys(Calendar.Views).map(k => Calendar.Views[k]);


const HomePage = () => {
    const [date, setDate] = useState(new Date())
    console.log(date);
    return (
     <div className="app">
        <Calendar
          localizer={localizer}
          startAccessor="start"
          endAccessor="end"
          views={allViews}
        />
     </div>
      )
}

export default HomePage;
